import "./ShowUsers.css";

const ShowUsers = (props) => {
  const users = props.users;
  console.log(users);
  return (
    <div className="users">
      <ul className="users ul">List of saved users</ul>
      {users.map((user) => {
        <li className="users li">
          {user.name} ({user.age} years old)
        </li>;
      })}
    </div>
  );
};

export default ShowUsers;
